import React from 'react';
import { ChakraProvider, Box, Heading, Button, Flex, ScaleFade } from '@chakra-ui/react';

function LandingPage() {
  return (
    <Flex height="100vh" alignItems="center" justifyContent="center">
      <Box textAlign="center">
        <ScaleFade initialScale={0.9} in={true}>
          <Heading size="2xl" mb="8" fontWeight="bold">
            Welcome to Our Website
          </Heading>
          <Button
            colorScheme="teal"
            mr="4"
            size="lg"
            _hover={{ transform: "scale(1.05)" }}
            _active={{ transform: "scale(0.95)" }}
          >
            Get Started
          </Button>
          <Button
            colorScheme="gray"
            ml="4"
            size="lg"
            _hover={{ transform: "scale(1.05)" }}
            _active={{ transform: "scale(0.95)" }}
          >
            Learn More
          </Button>
        </ScaleFade>
      </Box>
    </Flex>
  );
}

function App() {
  return (
    <ChakraProvider>
      <LandingPage />
    </ChakraProvider>
  );
}

export default App;
